import React from 'react';
import { Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import './Review.css'

const Review = ({product}) => {
    const{product_name,img,tag,price}=product;
    return (
        <div>
            <div className="product m-3 p-3">
            <h6 className="text-start text-light m-2"><span className="py-1 px-2 customround">{tag}</span></h6>
            <img className="w-50 image" src={img} alt="" />
            <div className="details">
            <h6>{product_name}</h6>
            <h6 className="text-success">$ {price}</h6>
            {/* <Link to={`/details/${key}`}>
            <Button className="btn btn-light text-primary">Add To Cart</Button>
            </Link> */}
            <Button className="px-2 custom-btn">Add To Cart</Button>
            </div>
           
        </div>
        </div>
    );
};

export default Review;
